По схеме к пинам A6 и A7 подключены кнопки с подтягивающим резистором к +5 В, то есть при нажатии на кнопку analogRead должен выдавать 0, при отпускании 1023. Оно так и работает, но только если использовать analogRead либо на А6, либо на А7, не вместе, как в коде выше. Сейчас эта работает так: при нажатии на кнопку, подключенную к А6, значение из функции ~400, на другой кнопке ~600, с кнопкой подключенной к А7 аналогичная ситуация, только цифры меняются местами. Также, если нажать одновременно на обе кнопки, то на обоих пинах будет 0. При выборе стандартного ядра код выше начинает работать правильно, естественно без изменений в нем, то есть A6 и A7 перестают быть связаны черной магией. Все расширенные настройки ядра стоят по дефолту, версия ядра 2.0.4', 'reactions': {'url': 'https://api.github.com/repos/AlexGyver/GyverCore/issues/32/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/AlexGyver/GyverCore/issues/32/timeline', 'performed_via_github_app': None, 'state_reason': 'completed', 'score': 1.0}]

