use std::path::Path;
use notify::{Watcher, RecursiveMode, Result, Event, EventKind};
use notify::event::CreateKind;
use clap::Parser;

#[derive(Parser, Debug)]
#[command(author, version, about, long_about = None)]
struct Args {
    #[arg(short, long, default_value = ".")]
    path: String,
}

fn main() -> Result<()> {
    ctrlc::set_handler(move || {
        println!("Ctrl-C received, exit...");
        std::process::exit(0);
    } ).expect("Set Ctrl-C handler error.");

    // Automatically select the best implementation for your platform.
    let mut watcher = notify::recommended_watcher(|res : Result<Event>| {
        match res {
            Ok(event) => {
                if event.kind == EventKind::Create(CreateKind::Any) {
                    let info = format!("path : {}", event.paths[0].to_str().unwrap());
                    println!("New file created, {}", info);
                    notifica::notify("Success - new file created", info.as_str()).expect("Show success notification failed.");
                }
            },
            Err(e) => println!("watch error: {:?}", e),
        }
    })?;

    let args = Args::parse();

    // Add a path to be watched. All files and directories at that path and
    // below will be monitored for changes.
    watcher.watch(Path::new(&args.path), RecursiveMode::Recursive)?;

    loop {
        std::thread::sleep(std::time::Duration::from_millis(60000));
    }
}
